#pragma once
// A decently (?) fast implementation of quadrilateral elements defined
// on the domain [0,1] x [0,1]. Polynomials are in the space Q_o,
// where o is the order of the element. So Q_2 contains xy, but
// also stuff like x^2 x^2 which isn't in P_2.
#include <array>

// Ideally, this will be a C++20 concept.
template<unsigned Order>
class ReferenceElement
{
public:

  static constexpr unsigned Npts = (Order+1)*(Order+1);
  static constexpr unsigned NEdgeNodes = Order-1;
  static constexpr unsigned NInternalNodes = (Order-1)*(Order-1);
  static constexpr unsigned Degree = Order;
  static constexpr std::array<double, Npts> node_xpoints = 0.0;
  static constexpr std::array<double, Npts> node_ypoints = 0.0;
  static inline std::array<double, Npts> evaluate_basis(double x, double y) {
    return {}; }
  static inline std::array<double, Npts> evaluate_deriv_x(double x, double y) {
    return {}; }
  static inline std::array<double, Npts> evaluate_deriv_y(double x, double y) {
    return {}; }
};

template<>
class ReferenceElement<1>
{
public:
  static constexpr unsigned Npts = 4;
  static constexpr unsigned NEdgeNodes = 0;
  static constexpr unsigned NInternalNodes = 0;
  static constexpr unsigned Degree = 1;
  static constexpr std::array<double, Npts> node_xpoints = {0.0,1.0,1.0,0.0};
  static constexpr std::array<double, Npts> node_ypoints = {0.0,0.0,1.0,1.0};
  static inline std::array<double, 4> evaluate_basis(double x, double y) {
    return {
    1-x-y+x*y,
    +x-x*y,
    +x*y,
    +y-x*y};
  }
  static inline std::array<double, 4> evaluate_deriv_x(double x, double y) {
    return {
    0*1-1.0+1*y,
    +1.0-1*y,
    +1*y,
    -1*y};
  }
  static inline std::array<double, 4> evaluate_deriv_y(double x, double y) {
    return {
    0*1-1.0+1*x,
    -1*x,
    +1*x,
    +1.0-1*x};
  }
};


